import React from "react";
//import CardBtn from "../CardBtn";
import "./style.css";

function Card(props) {
  return (
    <div
      className="card"
      style={{
        backgroundImage: props.image ? `props.image` : "none"
      }}
    >
      {/* {!props.image && <i className="fa fa-spinner fa-spin" aria-hidden="true" />} */}
      <img src={props.image}></img>
    </div>
  );
}

export default Card;
